import { VARCHAR } from 'axios/AxiosUtils';
import { EVENT_RECEPTION_TIMESTAMP } from 'common/model/Event';
import { EVENT_LOCAL } from 'common/model/Event';
import { EVENT_UF } from 'common/model/Event';
import { EVENT_VEHICLE_PLATE } from 'common/model/Event';
import { EVENT_VEHICLE_MODEL } from 'common/model/Event';
import { EVENT_TOTAL_VALUE } from 'common/model/Event';
import { EVENT_VEHICLE_COLOUR } from 'common/model/Event';
import { EVENT_VEHICLE_TYPE } from 'common/model/Event';
import { EVENT_CREATION_TIMESTAMP } from 'common/model/Event';
import { MDFE_DESTINATION } from 'common/model/Mdfe';
import { MDFE_ORIGIN } from 'common/model/Mdfe';
import { MDFE_KEY } from 'common/model/Notification';
import { NFE_KEY } from 'common/model/Notification';
import { FISCAL_NOTIFICATION_STATUS } from 'common/model/Notification';
import { ID } from 'common/model/Notification';
import { CPF_RECIPIENT } from 'common/model/WarningConfig';
import { CPF_NFE_ISSUER } from 'common/model/WarningConfig';
import { CPF_MDFE_ISSUER } from 'common/model/WarningConfig';
import { CNPJ_MDFE_ISSUER } from 'common/model/WarningConfig';
import { NAME } from 'common/model/WarningConfig';
import { CNPJ_NFE_ISSUER } from 'common/model/WarningConfig';
import { CNPJ_RECIPIENT } from 'common/model/WarningConfig';
import { CPF_DRIVER } from 'common/model/WarningConfig';
import { ID_CONFIG } from 'common/model/WarningConfig';
import { SEVERITY } from 'common/model/WarningConfig';
import { eventDfeFilter, moneyFilter, dateFilter, ufFilter } from 'components/tags/filterPresets';
import { warningStatusFilter, dfeFilter, priorityFilter, integerFilter, cpfFilter, cnpjFilter } from 'components/tags/filterPresets';


export const defaultFilters = {
    "Passagem": {
      field: EVENT_CREATION_TIMESTAMP,
      ...dateFilter
    },
    "Recebimento": {
      field: EVENT_RECEPTION_TIMESTAMP,
      ...dateFilter
    },
    "Local": {
      field: EVENT_LOCAL,
      column_type: VARCHAR,
      size: 120
    },
    "UF Disparo": {
      field: EVENT_UF,
      ...ufFilter
    },
    "UF Origem": {
      field: MDFE_ORIGIN,
      ...ufFilter
    },
    "UF Destino": {
      field: MDFE_DESTINATION,
      ...ufFilter
    },
    "Placa": {
      field: EVENT_VEHICLE_PLATE,
      only_letters_and_numbers: true,
      column_type: VARCHAR,
      size: 8,
    },
    "Veículo": {
      field: EVENT_VEHICLE_TYPE,
      column_type: VARCHAR,
      size: 20
    },
    "Modelo": {
      field: EVENT_VEHICLE_MODEL,
      column_type: VARCHAR,
      size: 40
    },
    "Cor": {
      field: EVENT_VEHICLE_COLOUR,
      column_type: VARCHAR,
      size: 20,
      only_letters_filter_input: true
    }
  }


  export const warningTableFiltersOptions = {
    "Prioridade": {
      field: SEVERITY,
      ...priorityFilter
    },
    "Ocorrência": {
      field: ID,
      size: 10,
      ...integerFilter
    },
    "Nº Alerta": {
      field: ID_CONFIG,
      size: 10,
      ...integerFilter
    },
    "Alerta": {
      field: NAME,
      column_type: VARCHAR
    },
    ...defaultFilters,
    "CPF": {
      field: [CPF_DRIVER, CPF_RECIPIENT, CPF_NFE_ISSUER, CPF_MDFE_ISSUER],
      ...cpfFilter
    },
    "CNPJ": {
      field: [CNPJ_RECIPIENT, CNPJ_MDFE_ISSUER, CNPJ_NFE_ISSUER],
      ...cnpjFilter
    },
    "DF-e": {
      field: [MDFE_KEY, NFE_KEY],
      ...dfeFilter
    },
    "Situação": {
      field: FISCAL_NOTIFICATION_STATUS,
      ...warningStatusFilter
    },
  }


  export const trafficNoDfeFiltersOptions = {
    "Passagem": {
      field: EVENT_CREATION_TIMESTAMP,
      ...dateFilter
    },
    "Recebimento": {
      field: EVENT_RECEPTION_TIMESTAMP,
      ...dateFilter
    },
    "Local": {
      field: EVENT_LOCAL,
      column_type: VARCHAR,
      size: 120
    },
    "UF Disparo": {
      field: EVENT_UF,
      ...ufFilter
    },
    "Placa": {
      field: EVENT_VEHICLE_PLATE,
      only_letters_and_numbers: true,
      column_type: VARCHAR,
      size: 8,
    },
    "Veículo": {
      field: EVENT_VEHICLE_TYPE,
      column_type: VARCHAR,
      size: 20
    },
    "Modelo": {
      field: EVENT_VEHICLE_MODEL,
      column_type: VARCHAR,
      size: 40
    },
    "Cor": {
      field: EVENT_VEHICLE_COLOUR,
      column_type: VARCHAR,
      size: 20,
      only_letters_filter_input: true
    }

  }


  export const trafficDfeFiltersOptions = {
    "Passagem": {
      field: EVENT_CREATION_TIMESTAMP,
      ...dateFilter
    },
    "Recebimento": {
      field: EVENT_RECEPTION_TIMESTAMP,
      ...dateFilter
    },
    "Local": {
      field: EVENT_LOCAL,
      column_type: VARCHAR,
      size: 120
    },
    "UF Disparo": {
      field: EVENT_UF,
      ...ufFilter
    },
    "Placa": {
      field: EVENT_VEHICLE_PLATE,
      only_letters_and_numbers: true,
      column_type: VARCHAR,
      size: 8,
    },
    "Veículo": {
      field: EVENT_VEHICLE_TYPE,
      column_type: VARCHAR,
      size: 20
    },
    "Modelo": {
      field: EVENT_VEHICLE_MODEL,
      column_type: VARCHAR,
      size: 40
    },
    "Cor": {
      field: EVENT_VEHICLE_COLOUR,
      column_type: VARCHAR,
      size: 20,
      only_letters_filter_input: true
    },
    "Valor agregado das DFES": {
      field: EVENT_TOTAL_VALUE,
      ...moneyFilter
    },
    "DF-e": {
      field: [MDFE_KEY, NFE_KEY],
      ...eventDfeFilter
    },
  }
